    useSelector((state) => state.myCaughtPokemon=myCaughtPokemon);
  });
  if (!myCaughtPokemon) {
    // dispatch(retrieveCaughtPokemonAction(userId));
    console.log("myCaughtPokemon", myCaughtPokemon);
  }



  

